import React, { useState } from "react";
import styles from "./Workers.module.css";
import Login from "../Authentication/Login";
import Workers from "./Workers";

const WorkersAuth = (props) => {
  const [isLog, setIsLog] = useState(true);
  function onContinueHandler() {
    setIsLog(false);
  }
  const [isLoginWindowOpen, setIsLoginWindowOpen] = useState(true);
  const authService = AuthenticationService.getInstance();
  console.log(authService.status);

  function onContinueHandler() {
    if (authService.getStatus() === true) {
      setIsLoginWindowOpen(false);
    }
  }

  return (
    <div className={styles.workersContainer}>
      <h2>Workers management module</h2>
      {isLog === true && <Login onContinue={onContinueHandler}></Login>}
      {isLog === false && <Workers></Workers>}
    </div>
  );
};
export default WorkersAuth;
